;(function () {
    //工具 funtion
    var Uilt = {};

    //获取登录状态
    Uilt.getLoginState = function () {
        Q($.getJSON('/gallery/front/login/info'))
        .then(function (data) {
            if (data.result) {
                //社交账号隐藏修改头像，修改密码;
                if (/QQ-|sinaWeibo-|weChat-/gi.test(data.data.userName)) {
                	$('.Js_none').hide();
                };
                $('.Js_name').empty().html(data.data.nickName);
                $('.logout').attr('href', data.data.logoutUrl);
                var headUrl = data.data.headImgUrl;
            	if (headUrl) {
            		if (headUrl.indexOf("http") < 0) {
            			headUrl = '/gallery/setting/getHeadImg?imgUrl=' + headUrl;
            		}
                	$("#headImage").attr('src', headUrl);
                } else {
                	$("#headImage").attr('src', '/gallery/images/2016cjy-grxx.png');
                }
            };
        })['catch'](function (e) {
            throw new Error(e);
        });
    }();

    //切换tab
    Uilt.TabSwitch = function (tabList, tabBody, className) {
        $(tabList).each(function (i) {
            $(this).children().first().addClass(className);

            $(this).on('click', 'li', function (e) {
                var ev = e || window.event,
                    index = $(this).index();

                ev.stopPropagation();

                $(this).addClass(className).siblings().removeClass(className);
                $(tabBody).eq(i).children().eq(index).show().siblings().hide();
            });
        });

        $(tabBody).each(function () {
            $(this).children().first().show();
        });
    };

    //转换时间戳
    Uilt.format = function (parma) {
        return new Date(parma).toLocaleDateString();
    };

    $(function () {
        window.Uilt = Uilt;
    });
})();
